window.bookSummaryJSON = "<p><b>Breach Bang and Clear.</b></p> <p>The battle begins against the Lich-Pharaoh as the Rangers go for a fatal strike against the Saurian-controlled Port of Sûstagul in the Land of Black Sleep.<br> <br> Brutal house-to-house fighting and relentlessly kinetic street battles erupt as special teams conduct high-value target raids against sorcerers, war chieftains, and deadly guilds of assassins in an effort to stop the Saur from joining forces with the powerful Nether Sorcerer. Failure lies around all the blind corners and damnation down every dark alley in this desperate bid to save civilization from the forces of a darkness beyond imagining. <br> <br> The Ruin is a very dark place…</p> <p><b>...but Rangers lead the way.</b></p> <p><b>Audio edition includes </b><b><i>WarGate After Action Report</i></b><b>, featuring Filipe Peters!</b></p>"; 
